interface ImgMap {
    [propname: string]: string;
}

const map: ImgMap = {
    rotate:
        "data:image/png;base64,",
    direct:
        "data:image/png;base64,",
    Parallelogram:
        "data:image/png;base64,",
    Triangle:
        "data:image/png;base64,",
    Echelon:
        "data:image/png;base64,",
    Irregular:
        "data:image/png;base64,",
    Ellipse:
        "data:image/png;base64,",
    p1:
        "data:image/png;base64,",
    p2:
        "data:image/png;base64,",
    p3:
        "data:image/png;base64,",
    p4:
        "data:image/png;base64,",
    p5:
        "data:image/png;base64,",
    t1:
        "data:image/png;base64,",
    t2:
        "data:image/png;base64,",
    t3:
        "data:image/png;base64,",
    t4:
        "data:image/png;base64,",
    t5:
        "data:image/png;base64,",
    t6:
        "data:image/png;base64,",
    e1:
        "data:image/png;base64,",
    e2:
        "data:image/png;base64,",
    e3:
        "data:image/png;base64,",
    I1:
        "data:image/png;base64,",
    I2:
        "data:image/png;base64,",
    el1:
        "data:image/png;base64,",
    el2:
        "data:image/png;base64,",
    buttonClear:
        "data:image/png;base64,"
};

interface ImgStore {
    [propname: string]: HTMLImageElement;
}

const Imgs: ImgStore = Object.create(null);

for (const key in map) {
    // 先标注他，晚点加载
    const img = new Image();
    img.src = map[key];
    img.onload = () => {
        Imgs[key] = img;
    };
}

export function getImg(key: string): HTMLImageElement {
    return Imgs[key];
}

export function getAllImg(): ImgStore {
    return Imgs;
}
